	('ece5f9d4-c5ca-422a-9129-229a543955b5', '3b1d1415-24ca-4576-b2bf-fcdbe0fb5a3e', 'בוא נעשה עוד טסט', '2025-05-18 10:16:08+03', '{"tags": [], "channel": null, "language": null, "sentiment_score": null, "external_message_id": null}', 'wamid.HBgMOTcyNTQyNDc1NzA1FQIAEhgUM0ZDQUEzODE5MzgwOTI1ODk5RUMA.1747552568', 'incoming', 'active', '2025-05-18 10:16:10.58+03', '2025-06-04 22:55:41.073196+03', NULL, '{}'),
	('1c40003f-2bdf-432a-a98d-3fac6134dc41', 'b1824525-cd98-4aa3-a3f5-b6a5a4de074a', 'כן עידן, המערכת עובדת מצוין! אני כאן לכל שאלה שיש לך בנוגע לדירות גג בתל אביב. האם היית רוצה לשמוע על כמה אפשרויות שעשויות להתאים לדרישות שלך בתקציב של 2.5 מיליון ש"ח? או שאולי יש לך שאלות נוספות לגבי תהליך הרכישה?', '2025-05-17 09:26:47+03', '{"tags": [], "channel": null, "language": null, "sentiment_score": null, "external_message_id": null}', 'wamid.HBgMOTcyNTQyNDc1NzA1FQIAEhggNjYzNDZDMEUyMzQ3NjM3NTcxNDdCOUU1ODhFOTBGMTEA.1747463237485', 'outgoing', 'active', '2025-05-17 09:27:17.486+03', '2025-06-04 22:55:41.073196+03', NULL, '{}'),
	('98969f74-2323-4ef0-9ada-3f5f8d1ec5f9', '9c918e59-5b5e-4f66-8653-16d4426150b6', 'היי שלום', '2025-05-18 10:23:46+03', '{"tags": [], "channel": null, "language": null, "sentiment_score": null, "external_message_id": null}', 'wamid.HBgMOTcyNTQyNDc1NzA1FQIAEhgUM0Y0MzMwMjBDMzQ2MkM5Mzg1OEQA.1747553026', 'incoming', 'active', '2025-05-18 10:23:48.154+03', '2025-06-04 22:55:41.073196+03', NULL, '{}'),
	('4b2db65f-dbe0-4a9e-9e1e-33f0e87dec78', '1555ed66-5717-4bcc-bb33-92124632f8c3', 'שלום אידן, שמחה לשמוע ממך! אני מקווה שהשבוע שלך עובר בצורה טובה. אני זוכרת שהתעניינת בדירות גג בתל אביב עם 4 חדרים ומעלה. האם אתה עדיין מחפש אפשרויות בתקציב של כ-2.5 מיליון ש"ח? אשמח לשמוע מה חדש בחיפוש שלך ואיך אוכל לעזור לך היום.', '2025-05-17 09:16:26+03', '{"tags": [], "channel": null, "language": null, "sentiment_score": null, "external_message_id": null}', 'wamid.HBgMOTcyNTQyNDc1NzA1FQIAEhgUM0Y5QTdEREQ5MzRBQkMwQTc2RDMA.1747462809972', 'outgoing', 'active', '2025-05-17 09:20:09.972+03', '2025-06-04 22:55:41.073196+03', NULL, '{}'),
	('e65661ca-da4d-48e3-9def-dbbf1283c602', 'b1824525-cd98-4aa3-a3f5-b6a5a4de074a', 'היי עידן דוד אביב לביא, אני אליאנה, העוזרת של אורון ממחלקת המכירות. אשמח לעזור לך בנוגע לפרויקט הבוטיק שלנו בשכונת נווה גן בפתח תקווה. במה אוכל לסייע?', '2025-05-21 18:55:35+03', '{"tags": [], "channel": null, "language": null, "sentiment_score": null, "external_message_id": null}', 'wamid.HBgMOTcyNTQyNDc1NzA1FQIAEhgUM0ZFOEZGQjEwNjk3MDAzOEM2MzUA.1747842953921', 'outgoing', 'active', '2025-05-21 18:55:53.921+03', '2025-06-04 22:55:41.073196+03', NULL, '{}'),
	('257a859c-77ca-4a9f-9eb2-0b167fe5ee41', '4d12c8bd-e996-4674-9bf3-9a68fc38e8fb', 'שלום עידן, אני מבין שאתה כבר לא מעוניין בדירת חדר בחדרה. אין שום בעיה, העדפות ותכניות יכולות להשתנות. האם יש איזור או סוג נכס אחר שמעניין אותך כרגע? אשמח לדעת מה הצרכים העדכניים שלך כדי שאוכל לעזור לך למצוא את הנכס המתאים עבורך. או שאולי תרצה לקחת זמן לחשוב על זה ולחזור אלי כשתהיה לך תמונה יותר ברורה?', '2025-05-18 13:57:30+03', '{"tags": [], "channel": null, "language": null, "sentiment_score": null, "external_message_id": null}', 'wamid.HBgMOTcyNTQyNDc1NzA1FQIAEhggN0Y3MzAyOUU0OUE3NzIzNTlDQUFBQzQwMjdERTE5QjAA.1747565886641', 'outgoing', 'active', '2025-05-18 13:58:06.641+03', '2025-06-04 22:55:41.073196+03', NULL, '{}'),
