	('1a777c23-753f-4f9f-9502-727b117e22f4', '4d12c8bd-e996-4674-9bf3-9a68fc38e8fb', 'אני מבינה שאתה מתעניין בדירת 4 חדרים, וזה בקצה העליון של התקציב שלך. דירות 4 חדרים אצלנו מתחילות ב-3,060,000 ש״ח, שזה אכן בטווח העליון של התקציב שציינת. לגבי הנחות, אני אשמח להעביר את הבקשה שלך למנהל המכירות שיוכל לדון איתך על אפשרויות תשלום גמישות. האם תרצה לקבוע שיחה עם אורון, מנהל המכירות שלנו? הוא יוכל לתת לך מידע מדויק על מבצעים אפשריים ולהציג בפניך את תכניות התשלום הגמישות שלנו.', '2025-05-23 16:17:49+03', '{"tags": [], "channel": null, "language": null, "sentiment_score": null, "external_message_id": null}', 'wamid.HBgMOTcyNTQyNDc1NzA1FQIAEhgUM0Y5QjhBODE1RjNFMDREQkU3RTEA.1748006289794', 'outgoing', 'active', '2025-05-23 16:18:09.794+03', '2025-06-04 22:55:41.073196+03', NULL, '{}'),
