	('6d272e93-9328-4e8b-9862-dbb5ed9b86e5', '3b1d1415-24ca-4576-b2bf-fcdbe0fb5a3e', 'שמחה לשמוע שאתם מחפשים דירה למגורים בפתח תקווה! פרויקט נווה גן שלנו הוא פרויקט בוטיק בן 7 קומות עם 4 דירות בקומה, במיקום מצוין. האם אתם מכירים את האזור של נווה גן בפתח תקווה?', '2025-06-05 12:02:37+03', '{"tags": [], "channel": null, "language": null, "sentiment_score": null, "external_message_id": null}', '.1749114176664', 'outgoing', 'active', '2025-06-05 12:02:56.664+03', '2025-06-05 12:02:56.724793+03', NULL, '{}'),
