	('84fdf7fa-9d4c-401a-839d-9cc1c3a6cf8d', '1555ed66-5717-4bcc-bb33-92124632f8c3', 'שמחה לספר לך על האזור והפרויקט שלנו!

הפרויקט ממוקם בשכונת נווה גן בפתח תקווה, אחת השכונות המבוקשות ביותר בעיר. זוהי שכונה צעירה ואיכותית, הנמצאת בקרבה לשכונות יוקרתיות ולמרכזי תעסוקה משמעותיים.

לגבי הפרויקט עצמו - מדובר בבניין בוטיק של 7 קומות בלבד, עם 4 דירות בכל קומה. אנו מציעים מגוון דירות: דירות 3-5 חדרים, דופלקסים 5 חדרים, ודירות גן.

כל דירה מגיעה עם חניה פרטית, מחסן צמוד, מפרט טכני גבוה הכולל מיזוג אוויר, ריצוף יוקרתי ומטבחים משודרגים.

המיקום מצוין - קרוב לרכבת הקלה, לצירי תנועה מרכזיים (דרך רבין, כביש 471), לפארק, למוסדות חינוך ולמרכזי תעסוקה כמו B.S.R ומרכז יכין.

