	('e9bafd9b-04ad-4849-8af5-43358a33ffb5', '4d12c8bd-e996-4674-9bf3-9a68fc38e8fb', 'אני מבינה שאתה מעוניין לדעת אם יש אפשרות להתאכלס בסוף השנה הבאה, כי אתה נמצא בחוזה שכירות עד אז.

